///#source 1 1 app.js
angular.module('ravelog', ['ravelog.controllers','ravelog.services', 'ui.state', 'ngGrid'])
.config(['$routeProvider', '$stateProvider', function ($routeProvider, $stateProvider) {

    $routeProvider.when('/log/information',
        {
            templateUrl: 'partials/log-grid.html',
            controller: 'InformationController'
        });

    $routeProvider.when('/test/submit',
        {
            templateUrl: 'partials/test.html',
            controller: 'TestController'
        });

    $routeProvider.otherwise({ redirectTo: '/test/submit' });

    $stateProvider
        .state('information', {
            url: "/log/information",
            templateUrl: "partials/log-grid.html"
        })
}]);
///#source 1 1 controllers.js
angular.module('ravelog.controllers', [])
    .controller('NavigationController', ['$scope', '$location', function ($scope, $location) {

        $scope.active = function (route) {
            return route === $location.path();
        }

    }])
  .controller('InformationController', ['$scope', '$http','log', function ($scope, $http, log) {

      log.getAll("http://localhost:8088/log/information", function (data) {
          $scope.logData = data;
      })

      $scope.grid = {
          data: 'logData',
          multiSelect: false
      };
  }])
  .controller('TestController', ['$scope', '$http', function ($scope, $http) {

      $scope.url = 'http://localhost:8088/log/information';
      $scope.payload = "{'dateCreated': '"+ moment().format() + "', 'application': 'ravelog test', 'message':'This is a test message.'}"

      $scope.send = function () {
          $http({
              url: $scope.url,
              data: $scope.payload,
              method: "POST",
              headers: {
                  "Content-Type": "application/json"
              }
          }).success(function (response) {
              $scope.response = response;
          });
      }
  }]);
///#source 1 1 services.js
angular.module('ravelog.services', [])
    .factory('log', ['$http', function($http){
        var log = {};

        log.getAll = function (url, callback) {
            $http({
                url: url,
                method: "GET",
                headers: {
                    "Content-Type": "application/json"
                }
            }).success(function (response) {
                callback(response);
            });
        }

        return log;
    }]);
///#source 1 1 states.js

